  [],\n\t\"revision_timestamp\": \"2016-07-27T22:21:10.054747\",\n\t\"name\": \"final-performance-report-snowy-plover-breeding-distribution\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Surveys of breeding populations and nesting
  habitat of the snowy plover were conducted from January to August, 1989 along the
  Gulf Coast of Florida and Alabama. Conservative estimates based upon observations
  of adults, nests, and families of plovers indicate at least 167 breeding pairs of
  snowy plovers were in Florida in 1989. At least 30 more pair are predicted to have
  been present in Alabama and Mississippi, making an estimated total of 200 pairs
  along the eastern Gulf Coast. Nearly all nests were located where the level of human
  activity was relatively low. Public lands with long, undeveloped beaches contained
  the most nests; only 22 pairs of plovers were found in south Florida, where undeveloped
  stretches of beach are rare. Of 85 nests sampled, most were near the front dune
  (mean distance = 10.5 m) and close to vegetation (mean distance = 1.4 m). Nests
  found after midsummer storms were more likely to be located in openings in the dune
  or behind the dunes. The fates of 83 nests were determined and 42% hatched. Storms,
  vehicles, predators, and humans accounted for the known causes of nest failure.
  More information about breeding biology, nesting success, and long term population
  trends is needed to assist in the conservation of snowy plovers. Immediately, continued
  and increased protection from human disturbance on public lands would be beneficial.
  In most areas, nesting success and the number of pairs present could be increased
  by reducing or altering vehicle traffic, concentrating human activities, and posting
  nesting areas against trespass.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
